import React from "react";
import { Col, Row } from "react-bootstrap";
import {
  SiLinux,
  // SiNumpy,
  SiVisualstudiocode,
  SiJupyter,
  SiPostman,
  SiHeroku,
  SiAcademia,
  SiTensorflow,
  SiPython,
  SiPytorch,
  SiKeras,
  SiLatex
} from "react-icons/si";
import { DiTrello } from "react-icons/di";

function Toolstack() {
  return (
    <Row style={{ justifyContent: "center", paddingBottom: "50px" }}>
      <Col xs={4} md={2} className="tech-icons">
        <SiTensorflow />
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <SiPytorch />
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <SiKeras />
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <SiPython />
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <SiKaggle />
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <SiJupyter />
      </Col>
    </Row>
  );
}

export default Toolstack;
